css:
atom-text-editor,
:host {
  background-color: #292E36;
  color: #F5F5F5;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #30353f;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #49483E;
}
atom-text-editor .invisible,
:host .invisible {
  color: #F5F5F5;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #F8F8F0;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #49483E;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid white;
}
atom-text-editor .gfm .markup.heading,
:host .gfm .markup.heading {
  color: #A3E076;
  font-weight: bold;
}
atom-text-editor .gfm .markup.underline,
:host .gfm .markup.underline {
  color: #E6B362;
  text-decoration: underline;
}
atom-text-editor .gfm .bold,
:host .gfm .bold {
  font-weight: bold;
}
atom-text-editor .gfm .italic,
:host .gfm .italic {
  font-style: italic;
}
atom-text-editor .gfm .raw,
:host .gfm .raw {
  color: #66D9EF;
}
atom-text-editor .gfm .variable.list,
:host .gfm .variable.list {
  color: #FB6060;
  font-weight: bold;
}
atom-text-editor .gfm .link,
:host .gfm .link {
  color: #CCC;
}
atom-text-editor .gfm .link .entity,
:host .gfm .link .entity {
  color: #B287FF;
}
.comment {
  color: #75715E;
}
.constant.character,
.constant.language,
.constant.numeric,
.constant.other {
  color: #B287FF;
}
.entity.name.class {
  text-decoration: none;
  color: #A3E076;
}
.entity.name.function {
  color: #A3E076;
}
.entity.name.instance {
  color: #66D9EF;
}
.entity.name.tag {
  color: #FB6060;
}
.entity.other.attribute-name {
  color: #A3E076;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: none;
  color: #A3E076;
}
.invalid {
  color: #F8F8F0;
  background-color: #FB6060;
}
.invalid.deprecated {
  background-color: #B287FF;
}
.keyword {
  color: #FB6060 !important;
}
.meta.tag {
  color: #F5F5F5;
}
.storage {
  color: #FB6060;
}
.storage.type {
  font-style: italic;
  color: #66D9EF;
}
.string {
  color: #E6B362;
}
.support.constant,
.support.function {
  color: #66D9EF;
}
.support.class,
.support.type {
  font-style: italic;
  color: #66D9EF;
}
.variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.variable.language.python,
.variable.language.js {
  color: #FB6060;
}
.class.jade {
  color: #B287FF;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
